// src/components/About.js
import React from 'react';

export default function About() {
  return (
    <section id="about" className="max-w-5xl mx-auto p-8">
      <h2 className="text-2xl font-semibold mb-4 text-blue-800">About Me</h2>
      <p className="leading-relaxed">
        Detail-oriented Full Stack Developer with 3.9+ years of experience building scalable, user-focused web applications using Angular, JavaScript,
        TypeScript, Node.js, Java, and AWS. Proficient in front-end and back-end development, clean code practices, performance optimization, and API 
        security.
      </p>
    </section>
  );
}
